	    updateCollections: function updateCollections(collections, cb, cbf) {
	        var _this = this;

	        if (_.isEmpty(collections)) {
	            _.isFunction(cb) && cb();
	            return;
	        }
	        var updateCollectionsArray = [],
	            db = pm.indexedDB.db,
	            trans = db.transaction(["collections"], "readwrite"),
	            store = trans.objectStore("collections");
	        updateCollectionsArray = _.map(collections, function (collection) {
	            return function (cb) {
	                var request = store.put(collection);
	                request.onsuccess = function (collection) {
	                    cb(null, collection);
	                };
	                request.onerror = function (e) {
	                    cb(e);
	                };
	            }.bind(_this);
	        });
	        _util2.default.asyncCall(updateCollectionsArray, function (err) {
	            if (_.isEmpty(err)) {
	                _.isFunction(cb) && cb();
	            } else {
	                _.isFunction(cbf) && cbf(err);
	            }
	        });
	    },

